  );
  return (
    <div className="App">
      <div>
        {name}
        {age}
        {email}
      </div>

      <div>
        {user}
      </div>

      <div>
        {user}
      </div>


      <UserAddress city='Delhi' street='Abc Road' pincode='110008'/>
      <UserAddress city='Lucknow' street='TK Road' pincode='150008' />
      <UserAddress/>

    </div>
  );
}


